mapper.select:
select * from sos_massage


    and id=#{id}


    and latitude=#{latitude}


    and longitude=#{longitude}


    and device_no=#{deviceNo}


    and gunMac ='%' #{gunMac} '%'


    and sos_time like '%' #{sosTime} '%'


    and finally_time like '%' #{finallyTime} '%'


    and body state '%' #{state} '%'


    and create_time like '%' #{createTime} '%'


    and update_time like '%' #{updateTime} '%'


    and version=#{version}

select 

from sos_massage
where id = #{id,jdbcType=INTEGER}
  and state = #{state,jdbcType=INTEGER}

mapper.delete:
delete from sos_massage
where id = #{id,jdbcType=INTEGER}
  and state = #{state,jdbcType=INTEGER}

